import React, { useState } from "react";
import { Grid, Paper, Typography, CardHeader, IconButton } from "@material-ui/core";
import '@fontsource/roboto';
import FacebookIcon from '@material-ui/icons/Facebook';
import EmailIcon from '@material-ui/icons/Email';
import LocalPhoneIcon from '@mui/icons-material/LocalPhone';
import { LocalPhone } from "@material-ui/icons";

const Contact = () => {
    //Style
    const style = {
        card: {
            marginTop: 5,
            marginBottom: 0,
            paddingTop: 20,
            paddingBottom: 40,
            backgroundColor: "#A9D1EA",
            color: "white",
            borderRadius: 5
        },
        emailIcon: {
            color: "white",
            position: "flex",
            alignItems: "right",
        },
        facebookIcon: {
            color: "white",
            position: "flex",
            alignItems: "left",
        }
    }
    return (
        <Grid container direction="row">
            <Grid item md="12" xs="12">
                <Paper style={style.card} elevation="5">
                    <CardHeader title="Contact" />
                    <Grid container direction="row" alignItems="center">
                        <Grid item md="5" xs="12">
                            <Typography>Email: loveyourbirthmidwifery@gmail.com</Typography>
                        </Grid>
                        <Grid item md="1" xs="6">
                            <IconButton>
                                <EmailIcon style={style.emailIcon}/>
                            </IconButton>
                        </Grid>
                        <Grid item md="1" xs="6">
                            <IconButton>
                                <FacebookIcon  style={style.facebookIcon}/>
                            </IconButton>
                        </Grid>
                        <Grid item md="5" xs="12">
                            <IconButton>
                                <LocalPhoneIcon />
                            </IconButton>
                        </Grid>
                    </Grid>
                </Paper>
            </Grid>
        </Grid>
    )
}

export default Contact;
